import "./Aside_Profile.scss"
import kentik from "./TVBp0EfZshg.jpg"

const Aside_Profile=()=>{
    return(
        <div className="Aside_Profile">
        <div className="Aside_Profile_content">
        <div className="content_columnfirst">
        <img src={kentik} alt="" />
        </div>
        </div>
        <div className="Aside_Profile_footer">
        </div>
        </div>
    );
}

export default Aside_Profile
